import React,{useState} from "react";
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';

function Signup() {
    const [name,setName]=useState("");
    const [password,setPassword]=useState("");
    const [email,setEmail]=useState("");

    async function signupPost(){
        let item={name,password,email};
        console.warn(name,email,password)
        let result = await fetch("http://localhost:8000/api/signupPost",{
            method: 'POST',
            headers: {
                'Content-Type':"application/json",
                'Accept':'application/json'
            },
            body:JSON.stringify(item)
        })
        result=await  result.json();
        console.warn("result",result);
    }
    return (
        <div className={"container"}>
            <Form className={"w-50 text-left"}>
                <Form.Group className="mb-3" controlId="formBasicName">
                    <Form.Label>Name</Form.Label>
                    <Form.Control type="text" name="name"  placeholder="Enter name" value={name} onChange={(e)=>setName(e.target.value)} />
                </Form.Group>
                <Form.Group className="mb-3" controlId="formBasicEmail">
                    <Form.Label>Email address</Form.Label>
                    <Form.Control name="email" type="email" placeholder="Enter email" value={email} onChange={(e)=>setEmail(e.target.value)}/>
                </Form.Group>

                <Form.Group className="mb-3" controlId="formBasicPassword">
                    <Form.Label>Password</Form.Label>
                    <Form.Control name="password" type="password" placeholder="Password" value={password} onChange={(e)=>setPassword(e.target.value)}/>
                </Form.Group>
                <Form.Group className="mb-3" controlId="formBasicCheckbox">
                    <Form.Check type="checkbox" label="Check me out" />
                </Form.Group>
                <Button onClick={signupPost} variant="primary" >
                    Submit
                </Button>
            </Form>
        </div>
    );
}
export default Signup
